import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const KeepData = (props) => {
    return (
        <>
            <div className = "container ">
                <div className = "row">
                    <div className = "col-md-3 col-12">
                        <div className = "disp1">
                            {props.value.map((values , index) => {
                                return <h5>{values}</h5>
                            })}
                            {props.value1.map((value , index) => {
                                return <p>{value}</p>
                            })}
                        </div>
                    </div>
                </div>
            </div> 
        </>
    );
}
export default KeepData;
